import './Sidebar.css'

const types = ["Hand Tossed", " Thin Crust", "Handmade Pan", "Gluten Free Crust"]

const pizzaTypes = types.map(types => <p>{types}</p>)

const items = () => {
    return (
        <div>
            <button>{pizzaTypes}</button>
        </div>
    )
}

export default items
